(273, 1, '2018-09-21 02:32:52', '2018-09-21 08:32:52', '<h1 class=\"pbot0\">We do this by</h1>\r\n<div class=\"fontsize2 pbot pl10 pr10\">\r\n<p class=\"bold mb0\">Helping people discover great places around them.</p>\r\nOur team gathers information from every restaurant on a regular basis to ensure our data is fresh. Our vast community of food lovers share their reviews and photos, so you have all that you need to make an informed choice.\r\n<p class=\"bold mb0\">Building amazing experiences around dining.</p>\r\nStarting with information for over 1 million restaurants (and counting) globally, we\'re making dining smoother and more enjoyable with services like <a href=\"https://www.zomato.com/order\">online ordering</a> and <a href=\"https://www.zomato.com/book\">table reservations</a>.\r\n<p class=\"bold mb0\">Enabling restaurants to create amazing experiences.</p>\r\nWith dedicated engagement and management tools, we\'re enabling restaurants to spend more time focusing on food itself, which translates directly to better dining experiences.\r\n\r\n</div>', 'About us', '', 'inherit', 'closed', 'closed', '', '272-revision-v1', '', '', '2018-09-21 02:32:52', '2018-09-21 08:32:52', '', 272, 'https://www.delhichaat.ca/272-revision-v1/uncategorized/', 0, 'revision', '', 0),
